function Footer() {
  return (
    <>
    <footer className='w-100 h-25 bg-light text-center mt-5'>
    <p>&copy; All Rights Reserved - Fajal Ansari - 2022 </p>
    </footer>   
    </>
  );
}

export default Footer;
